import React from "react";

const navbar = () => {
  return (
    <div>
      <nav class="navbar navbar-light bg-light">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">
            <img
              src="../img/logopoke.png"
              alt=""
              width="50%"
              height="25%"
              class="d-inline-block align-text-top"
            ></img>
          </a>
        </div>
      </nav>
    </div>
  );
};

export default navbar;
